body {
      font-family: Roboto;
}
.container {
      width: 100%;
      padding-right: 15px;
      padding-left: 15px;
      margin-right: auto;
      margin-left: auto;
}

@media (min-width: 576px) {
      .container {
            max-width: 540px;
      }
}

@media (min-width: 768px) {
      .container {
            max-width: 720px;
      }
}

@media (min-width: 992px) {
      .container {
            max-width: 960px;
      }
}

@media (min-width: 1200px) {
      .container {
            max-width: 1140px;
      }
}

.no-gutters {
      margin-right: 0;
      margin-left: 0;
}
.no-gutters > .col,
.no-gutters > [class*="col-"] {
      padding-right: 0;
      padding-left: 0;
}

.book__subtitle {
      margin: 24px 0 0px 0;
}
input {
      outline: none;
      box-sizing: border-box;
}
.book__dates {
      display: flex;
      border: 1px solid #dadee7;
      border-radius: 8px;
      justify-content: space-between;
      align-items: baseline;
}
.book__field {
      border: 1px solid #dadee7;
      border-radius: 8px;
      margin-top: 12px;
      background: transparent;
      z-index: -1;
      font-size: 16px;
      padding: 4px 12px 12px 12px;
}
.book__field-active {
      border: 1px solid #000000;
      border-radius: 8px;
      margin-top: 12px;
      background: white;
      z-index: -1;
      font-size: 16px;
      padding: 4px 12px 12px 12px;
}
input.book__field {
      padding: 16px 12px 0 12px;
      height: 60px;
      width: 100%;
}

.book__field-value {
      display: inline;
      border: none;
      background: transparent;
}
input.book__field-value {
      height: 60px;
      padding: 16px 2px 2px 12px;
      width: 100%;
      border: 1px solid transparent;
      font-size: 14px;
}
.book__dates .book__field-start .book__field-subtitle,
.book__dates .book__field-end .book__field-subtitle {
      top: 4px;
}
.book__field-start,
.book__field-end {
      width: 32%;
      display: inline-flex;
}
.book__field-end {
      border-left: 1px solid #dadee7;
}

