    .book__field-start{
	    left: -100%;
    }

    .book__field-end {

	    left: -50%;
    }
    */
input.book__field-value:focus {
      border: none;
}
.book__field-wrap {
      position: relative;
}
.book__field-subtitle {
      line-height: 24px;
      top: 18px;
      left: 12px;
      color: #959ba4;
      pointer-events: none;
      user-select: none;
      font-size: 13px;
      overflow: hidden;
      white-space: nowrap;
      box-sizing: border-box;
      text-overflow: ellipsis;
}
.book__field-wrap .book__field-subtitle {
      position: absolute;
}
.customPlace-visible .book__field-subtitle {
      top: 18px;
}
.book__field:valid {
      /* border: solid #bbdcd9 1px; 
	    background: transparent; */
}

.book__field-value {
      font-size: 16px;
      color: #000000;
}
input:-webkit-autofill,
input:-webkit-autofill:hover,
input:-webkit-autofill:active,
textarea:-webkit-autofill,
textarea:-webkit-autofill:hover,
textarea:-webkit-autofill:active,
select:-webkit-autofill,
select:-webkit-autofill:hover,
select:-webkit-autofill:active {
      -webkit-box-shadow: 0 0 0px 1000px #fafafb inset !important;
}
.book-page input:focus {
      background: white;
      border: 1px solid #000000;
      border-radius: 8px;
}
input.ex-inputs-end:focus,
input.ex-inputs-start:focus {
      background: transparent;
      border: none;
      border-bottom: 2px solid #000000;
      border-radius: 0;
      padding: 16px 12px 0 13px;
}

.book-page {
      max-width: 900px;
      margin: 0 auto;
}
.book__checkbox {
      position: absolute;
      z-index: -1;
      opacity: 0;
      cursor: pointer;
}
.book__checkbox + label {
      display: inline-flex;
      align-items: center;
      user-select: none;
      cursor: pointer;
      margin: 6px 0;
}
.book__checkbox + label::before {
      content: "";
      display: inline-block;
      width: 24px;
      height: 24px;
      flex-shrink: 0;
      flex-grow: 0;
      border: 1px solid #dadee7;
      border-radius: 4px;
      margin-right: 12px;
      background-repeat: no-repeat;
      background-position: center center;
      background-size: 50% 50%;
      cursor: pointer;
}
.book__checkbox:checked + label::before {
      border-color: #f9b702;
      background-color: #f9b702;
      background-image: url("data:image/svg+xml,%3csvg xmlns='http://www.w3.org/2000/svg' viewBox='0 0 8 8'%3e%3cpath fill='%23fff' d='M6.564.75l-3.59 3.612-1.538-1.55L0 4.26 2.974 7.25 8 2.193z'/%3e%3c/svg%3e");
}
.book__checkbox:not(:disabled):not(:checked) + label:hover::before {
      background-color: #fff2d0;
      border-color: #ffe7ab;
}
.book__checkbox:not(:disabled):active + label::before {
      background-color: #fff2d0;
      border-color: #ffe7ab;
}
.book__checkbox:focus:not(:checked) + label::before {
      border-color: #ffe7ab;
}
.book__checkbox:disabled + label::before {
      background-color: #fff2d0;
}
#lawAgreement {
      margin-top: 16px;
}
.book__btn {
      color: #fff;
      background: #000000;
      padding: 6px 12px;
      margin: 12px 0;
      text-align: center;
      display: block;
      width: 100%;
      height: 60px;
      border: none;
      border-radius: 8px;
      transition-delay: 0.05s;
      transition-duration: 0.25s;
      transition-property: all;
}
.book__btn:hover {
      background: #f7b903;
      box-shadow: 16px 26px 25px -25px #f7b903;

      cursor: pointer;
}

.book__btn_send {
      color: #fff;
      background: #000000;
      padding: 6px 12px;
      margin: 12px 0;
      text-align: center;
      display: block;
      width: 100%;
      height: 60px;
      border: none;
      border-radius: 8px;
      transition-delay: 0.05s;
      transition-duration: 0.25s;
      transition-property: all;
}
.book__radio {
      font-size: 13px;
}
.book__checkup {
      font-size: 14px;
      color: #959ba4;
      margin: 32px 0;
}
.book__place-options {
      display: none;
      list-style-type: none;
      margin: -8px 0 0 0;
      padding: 8px 0 0 0;
      background: #ffffff;
      border: 1px solid #000000;
      border-top: none;
      border-top-left-radius: 0;
      border-top-right-radius: 0;
      border-bottom-left-radius: 8px;
      border-bottom-right-radius: 8px;
      transition: all 0.2s;
      box-shadow: 16px 26px 25px -25px #abb6c5;
}
.book__place-options li {
      padding: 18px 12px;
      border-top: 1px solid #dadee7;
}
ul.book__place-options li:hover {
      background: #dadee7;
}
.show {
      display: block;
}

.validationFailed {
      border: red 1px solid;
      border-radius: 8px;
}

.validationPartedPassed {
      border: magenta 1px solid;
      border-radius: 8px;
}

.customPlace-hidden {
      display: none;
      animation: ease hidden 0.2s;
}

.customPlace-visible {
      display: block;
      animation: ease visible 0.2s;
}
@keyframes visible {
      from {
            opacity: 0;
            height: 0px;
      }
      to {
            opacity: 100;
            height: 60px;
      }
}
@keyframes hidden {
      from {
            opacity: 100;
            height: 60px;
      }
      to {
            opacity: 0;
            height: 0px;
      }
}
.book__field-cost-option {
      color: red;
}
.book__field-receivePlaceSelect {
      width: 100%;
      height: 60px;
      padding: 16px 0 0 8px;
      box-sizing: border-box;
}
.customPlace .book__field-subtitle {
      margin-top: -12px;
}

input::placeholder {
      color: #969699;
}
input[type="range"] {
      height: 2px;
      -webkit-appearance: none;
      margin: 10px 0;
      width: 44%;
}
input[type="range"]:first-of-type {
      margin: 10px 24px 10px 0;
}
input[type="range"]:focus {
      outline: none;
      border: none;
}
input[type="range"]::-webkit-slider-runnable-track {
      width: 100%;
      height: 3px;
      cursor: pointer;
      background: linear-gradient(90deg, #f9b702 80%, #ff4463);
      border-radius: 5px;
      border: 2px solid #ffffff;
}
input[type="range"]::-webkit-slider-thumb {
      border: 2px solid #ffffff;
      height: 3px;
      width: 38px;
      border-radius: 15px;
      background: #f9b702;
      cursor: pointer;
      -webkit-appearance: none;
      margin-top: -3px;
}
input[type="range"]:focus::-webkit-slider-runnable-track {
      background: #f9b702;
}
input[type="range"]::-moz-range-track {
      width: 100%;
      height: 3px;
      cursor: pointer;
      background: linear-gradient(90deg, #f9b702 80%, #ff4463);
}
input[type="range"]::-moz-range-thumb {
      border: 2px solid #ffffff;
      height: 24px;
      width: 24px;
      border-radius: 24px;
      background: #f9b702;
      cursor: pointer;
}
input[type="range"]::-ms-track {
      width: 100%;
      height: 3px;
      cursor: pointer;
      background: #f9b702;
      border-color: transparent;
      color: transparent;
}
input[type="range"]::-ms-fill-lower {
      background: #f9b702;
      border: 2px solid #ffffff;
      border-radius: 15px;
}
input[type="range"]::-ms-fill-upper {
      background: #f9b702;
      border: 2px solid #ffffff;
      border-radius: 15px;
}
input[type="range"]::-ms-thumb {
      margin-top: 1px;
      border: 2px solid #ffffff;
      height: 20px;
      width: 38px;
      border-radius: 15px;
      background: #f9b702;
      cursor: pointer;
}
input[type="range"]:focus::-ms-fill-lower {
      background: #f9b702;
}
input[type="range"]:focus::-ms-fill-upper {
      background: #f9b702;
}

