.ex-inputs {
      position: relative;
}

.ex-inputs-picker {
      position: absolute;
      z-index: 1000;
      left: 49.9%;
      top: calc(100% + 6px);
      opacity: 0;
      z-index: -20;
      transform: translateX(-50%);
      transition: all 0.25s;
      width: 100%;
}

.ex-inputs-picker-visible {
      opacity: 1;
      z-index: 1000;
}

